import logo from './logo.svg';
import './App.css';
import Navbar from './Components/Navbar.js';
import {Home} from './Components/Home.js';
import About from './Components/About.js';



function App() {
  return (
  <>

  <Route>
<Navbar/>

<Switch>
          <Route exact path="/about">
            <About />
          </Route>
          <Route path="/home">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
        </Route>

  </>
  );
}

export default App;
